  var npl = [];
  
  for(var i=0;i<points.length;i++){
    np.push(ApplyRotations(XY,XZ,XW,YZ,YW,ZW,[0,0,0,0],points[i]));
  }
  strokeWeight(lt);
  drawPoints(np);
  drawQLines(np,qlines);
